import React from "react";
import { Route } from "react-router";
import TopBarNoItems from "../../components/TopBar/TopBarNoItems";
const LayoutAdmin = (props) => {
  const [openDrawer, setOpenDrawer] = useState(false);
  return (
    <>
      <TopBar openDrawer={openDrawer} setOpenDrawer={setOpenDrawer} />
      <NavBar openDrawer={openDrawer} setOpenDrawer={setOpenDrawer} />
      {props.children}
    </>
  );
};

const AdminTemplate = ({ Component, ...props }) => {
  return (
    <LayoutAdmin>
      <Route
        exact={props.exact}
        path={props.path}
        component={props.component}
      />
    </LayoutAdmin>
  );
};

export default AdminTemplate;
